import 'bootstrap/dist/css/bootstrap.min.css';
import { Route } from 'react-router';
import Header from './components/Header';
import HomePage from './pages/HomePage';

function App() {
  return (
    <div>
      <Header />
      <Route path="/" exact={true} component={HomePage} />
    </div>
  );
}

export default App;
